          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "6",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "7",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "8",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "9",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        }
    ];

    return (
        <>
            <div className = 'mx-auto'>

            </div>
            <CustomListComp data = { users } />
        </>
    );
}

export default UserListComp;
